vector: true

script: |
  super -f text -I q310.spq | sort > q310.out

inputs:
  - name: q310.spq
    data: |
      SELECT e
      FROM t1 (FORMAT parquet)
      WHERE c>d
      AND coalesce(a,b,c,d,e)<>0
      AND a>b;
  - name: t1

outputs:
  - name: q310.out
    data: |
      132
      173
      180
      189
      210
